ITE_LINK_ADDON_COMPETITION:"Addon competition",WEBSITE_LINK_ART_CONTEST:"Art contest",WEBSITE_MY_ACCOUNT:"Mon compte",WEBSITE_MAINPAGE_FAQ_001_H1:"Qu'est-ce que Stremio ?",WEBSITE_MAINPAGE_FAQ_001_P1:"Stremio est un centre de mdias moderne qui vous donne la libert de regarder tout ce que vous voulez.",WEBSITE_MAINPAGE_FAQ_002_H1:"Comment cela fonctionne ?",WEBSITE_MAINPAGE_FAQ_002_P1:"Une fois que vous avez install Stremio sur votre appareil et que vous avez cr un compte, il vous suffit de vous rendre dans le catalogue d'addons et d'installer tous les addons que vous voulez, et c'est parti !",WEBSITE_MAINPAGE_FAQ_002_P2:"Ensuite, vous pouvez vous rendre dans les sections Dcouvrir ou Tableau pour commencer  explorer le contenu.",WEBSITE_MAINPAGE_FAQ_003_H1:"Que puis-je regarder ici ?",WEBSITE_MAINPAGE_FAQ_003_P1:"Beaucoup : Films, missions de tlvision, chanes Internet, sport, chanes de tlvision, couter de podcasts et bien d'autres choses encore. Grce  notre systme d'addons, vous pouvez accder  une grande varit de contenus.",WEBSITE_MAINPAGE_FAQ_004_H1:"Stremio est-il open-source ?",WEBSITE_MAINPAGE_FAQ_004_P1:"Oui, vous pouvez consulter les liens suivants: ${1}application de bureau${2} et ${3}Organisation GitHub${4}.",WEBSITE_MAINPAGE_FAQ_005_H1:"Stremio est-il sans danger ?",WEBSITE_MAINPAGE_FAQ_005_P1:"Oui: comme il s'agit d'un logiciel open-source, le code est publiquement contrlable et vous pouvez l'examiner vous-mme.",WEBSITE_MAINPAGE_FAQ_006_H1:"Qu'en est-il de ma vie prive ?",WEBSITE_MAINPAGE_FAQ_006_P1:"Nous respectons la vie prive des utilisateurs et ne recueillons aucune donne personnelle en dehors du minimum indispensable pour crer et synchroniser votre compte.",WEBSITE_MAINPAGE_FAQ_006_P2:"Il existe galement un ${1}Mode invit${2}  l'inscription, qui ne ncessite aucune donne particulire : dans ce mode, aucune requte n'est effectue vers notre serveur. Toutefois, cela se fait au dtriment de fonctions importantes, telles que la possibilit de synchroniser votre bibliothque entre les appareils.",WEBSITE_MAINPAGE_FAQ_007_H1:"Puis-je caster sur ma TV ?",WEBSITE_MAINPAGE_FAQ_007_P1:"Oui, nous supportons Chromecast et vous pouvez caster  partir des applications bureau et mobiles (Android).",WEBSITE_MAINPAGE_FAQ_008_H1:"Combien d'addons possde Stremio ?",WEBSITE_MAINPAGE_FAQ_008_P1:"Fin 2019, plus de 50 - pour plus d'informations, consultez notre catalogue d'addons.",WEBSITE_MAINPAGE_FAQ_009_H1:"Stremio peut-il tre tendu au-del de ce qui se trouve dans le catalogue de l'addon ?",WEBSITE_MAINPAGE_FAQ_009_P1:"Oui, vous devriez faire un tour ici: ${1}PimpMyStremio${2}, ${3}Communauts Reddit${4}, ${5}Stremio Downloader${6}, etc.",WEBSITE_MAINPAGE_FAQ_010_H1:"Quels sont les appareils pris en charge par Stremio ?",WEBSITE_MAINPAGE_FAQ_010_P1:"Nous avons des applications de bureau pour Windows, Mac et Linux. Pour les mobiles, nous prenons en charge Android et iOS, tout en gardant  l'esprit que la version iOS est limite dans ses fonctionnalits (elle ne prend pas en charge la plupart des addons).",WEBSITE_MAINPAGE_FAQ_010_P2:"Il existe de nombreux appareils bass sur Android sur lesquels vous pouvez faire tourner Stremio, comme NVIDIA Shield et Amazon Fire Stick, mais nous ne les supportons pas officiellement.",WEBSITE_MAINPAGE_FAQ_011_H1:"Pouvez-vous ajouter certains contenus  Stremio ?",WEBSITE_MAINPAGE_FAQ_011_P1:"Dsol, nous ne fournissons pas de contenu nous-mmes, mais plus vous avez install d'addons Stremio, plus vous serez en mesure de trouver du contenu.",WEBSITE_MAINPAGE_FAQ_012_H1:"Stremio peut-il jouer les liens magnet ?",WEBSITE_MAINPAGE_FAQ_012_P1:"Oui, et il peut galement lire des liens HTTP normaux et des fichiers torrents (glisser-dposer).",WEBSITE_MAINPAGE_FAQ_013_H1:"Puis-je tlcharger une vido et la regarder hors ligne ?",WEBSITE_MAINPAGE_FAQ_013_P1:"La disponibilit hors ligne est une fonctionnalit  venir, mais si vous autorisez Stremio  se mettre en cache sur votre appareil ( partir du panneau de configuration), vous pouvez regarder les vidos plus tard sans connexion.",WEBSITE_MAINPAGE_FAQ_014_H1:"Rien ne marche, aidez-moi !",WEBSITE_MAINPAGE_FAQ_014_P1:"tes-vous sr d'avoir install des addons ? Si oui, vrifiez auprs de notre ${1}centre d'aide${2}.",WEBSITE_MAINPAGE_FAQ_015_H1:"Comment Stremio soutient-il ses oprations de dveloppement ?",WEBSITE_MAINPAGE_FAQ_015_P1:"Nous diffusons des annonces non intrusives par le biais de ${1}AdEx${2}, qui est une entreprise de la mme quipe fondatrice qui se concentre sur la prservation de la vie prive et la transparence des annonces.",WEBSITE_MAINPAGE_FAQ_015_P2:"Pour plus de questions, consultez notre ${1}centre d'aide${2}.",HELP_LEARN_MORE:"Aidez-nous  mieux vous connatre.",LIFESTYLE:"Lifestyle",SPORTS:"Sports",FOOD_HEALTH:"Alimentation & Sant",BEAUTY_FASHION:"Beaut & Mode",NEWS:"News",GAMING:"Gaming",SCIENCE_EDUCATION:"Science & Education",MUSIC:"Musique",TRAVEL:"Voyages",LATE_NIGHT:"Late Night",REALITY:"TV Realit",COMEDY:"Comdie",DIY:"DIY",TECH:"Tech",CINEMA:"Cinema",CONTINUE:"Continuer",SLOW_LOADING:"CHARGEMENT LENT ?",I_GIVE_UP:"J'ABANDONNE",LEARN_MORE:"En savoir plus",POOR_SOURCE:"Cette source est difficilement accessible ou votre connexion Internet n'est pas assez rapide.",PICK_CATEGORIES_ERR:"Vous devez choisir au moins 3 catgories",ADJUST_TIMING:"Ajuster le timing avec ",ADJUST_SIZE:"Ajuster la taille avec ",SEARCH_ANYTHING:"Vous pouvez tout rechercher ...",ALL_CATEGORIES:"Tous",SEARCH_CATEGORIES:"Films, Sries, YouTube & TV",SEARCH_PERSONS:"Acteurs, Ralisateurs et Scnaristes",SEARCH_PROTOCOLS:"HTTP & Liens Magnet",SEARCH_TYPES:"Liens IMDB / TVDB",WATCHED:"Regard",SHOW_LESS:"Afficher Moins",LAST_SEARCHES:"Dernires recherches",CLEAR_HISTORY:"Effacer l'historique",CHOOSE_SOME:"CHOISISSEZ-EN CERTAINS:",NO_WEB_REMOTE:"La tlcommande Web n'a pas pu tre charge",STREMIO_OFFLINE:"Stremio est hors-ligne",STREMIO_EXPENSIVE_CONNECTION:"Une connexion rseau cote cher",USE_DATA:"Utiliser les donnes",WARNING:"Attention",MORE_INFO:"Plus d'infos ...",ST